    return (
      <div>
        <Tabs />
        <div>
          {conso}
          {model.map((cat) => (
            <div className="cards">
              {Object.keys(cat).map((indiv, index) => (
                //   {if(this.state.model_name == index){

                // }}
                <div>
                  {cat[indiv].map((co) => (
                    <>
                      <div className="car_pic">
                        <img alt="car-pic" src={co.location} />
                      </div>
                      <div className="model_name">{co.model_name}</div>
                      <div className="more_info">
                        <button className="btn">View Latest Offers </button>
                      </div>
                    </>
                  ))}
                </div>
              ))}

              {/* {Object.keys({ vals }).map((key, index) => ( */}
              {/* // {Object,keys({index[0]}).map((keys,in) => ( */}
              {/* <div>
                  <
                  {console.log(vals[key])}
                </div>
              </div>


              ))} */}
            </div>
          ))}
        </div>
      </div>
    );
  }
}
export default Catelog;
